INSERT INTO `pages` VALUES (1,'About Us','<h1><i>When founder Christian set out to buy a gift for his wife, he started the way he normally did: with a call to his sister and friends to ask for advice on what to get her. &nbsp;He thought there had to be a better way.</i></h1><h1><i><br></i><i>That drove him to build&nbsp;Painless Gift. A place to browse and save gift options for everyone in your life. A place to connect with others who have been there too. Whether you are looking for a specific gift for right now, or sometime in the future the Painless Gift community is here to help. When you are ready to start your&nbsp;search, Painless Gift is the best place to get inspired, find products, and discover that special gift.</i></h1><div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<b><i><br><br></i></b></div><br><br><br><br>','about-us'),(2,'Terms and Conditions','','terms-and-conditions'),(3,'Getting Started!','<b><span class=\"wysiwyg-color-red\"></span></b><h1><i>Painless gift was started on the simple concept of \"optimizing the gift giving experience\".</i></h1><h1><span class=\"wysiwyg-color-red\"></span></h1><h1><i>Our Mission is to remove&nbsp;the stress and insecurities that are sometimes associated&nbsp;with trying to find the perfect gift.</i></h1><h1><br><span class=\"wysiwyg-color-red\"><i>All you need to know is:<br></i></span><br><ul><li><span class=\"wysiwyg-color-red\"><u><i>WHO</i></u><i> you are buying a gift for&nbsp;<br><br></i></span></li></ul><ul><li><span class=\"wysiwyg-color-red\"><u><i>HOW MUCH</i></u><i> you would like to spend</i></span></li></ul><span class=\"wysiwyg-color-red\"><b><br></b></span><span class=\"wysiwyg-color-red\"><i>It\'s that SIMPLE!</i></span></h1><br><br><br><br><br><br>','getting-started!'),(4,'Contact Us','Have a gift idea? &nbsp;Email us at giftideas@painlessgift.com&nbsp;<br><br>Please be sure to&nbsp;include:<br><ul><li>Hyperlink (site address)&nbsp;for the gift&nbsp;</li></ul><ul><li>The person you would recommend this gift for&nbsp;</li></ul><ul><li>If you would like, your name and contact information&nbsp;</li></ul><br>For general inquiries please email info@painlessgift.com<br><br>','contact-us');
/*!40000 ALTER TABLE `pages` ENABLE KEYS */;
UNLOCK TABLES;

