INSERT INTO `products` VALUES (1,'Lulu Lemon Wonder Under Crop ','<h2>fabric + features</h2><div><ul><li>this updated version is a little longer for more coverage</li><li>a tight-knit version of our Luon® fabric – Full-On Luon fabric gives incredible support and coverage with a cottony-soft feel</li><li>technical fabric is sweat-wicking, four-way stretch and breathable</li><li>added LYCRA®&nbsp;fibre bends with you and stays in great shape</li><li>tight fit is great for checking your alignment in the mirror</li><li>wide, soft waistband is designed to eliminate muffin top</li><li>stash your keys and gym pass in our signature waistband pocket</li><li>imported</li></ul></div><h2>fit + function</h2><div><ul><li><b>designed for:&nbsp;</b>yoga, gym – you name it!</li><li><b>fabric(s):&nbsp;</b><div>Full-On Luon®</div></li><li><b>fit:&nbsp;</b>tight</li><li><b>rise:&nbsp;</b>medium</li><li><b>inseam:&nbsp;</b>211/2\"&nbsp;</li><li><b>leg opening:&nbsp;</b>111/8\"</li><li><b>hemmable:&nbsp;</b>yes</li></ul></div>','lulu-lemon-wonder-under-crop',88,'Screen_Shot_2015-09-14_at_11.55.44_AM.png','http://shop.lululemon.com/products/clothes-accessories/crops-yoga/Wunder-Under-Crop-II-Full-On-Luon?cc=1497&skuId=3617694&catId=crops-yoga=painlessgift',21,40,'mf','Apparel'),(2,'Marc Jacobs Clutch ','A gleaming logo plate fronts a petite crossbody bag crafted from buttery pebbled leather. Soft pleats add a spark of drama, and an optional shoulder strap makes styling a snap.<ul><li>Magnetic-flap closure.</li><li>Optional strap.</li><li>Six interior card slots.</li><li>Leather.</li><li>By MARC BY MARC JACOBS; imported.</li></ul>','marc-jacobs-clutch',258,'Screen_Shot_2015-09-15_at_7.47.35_PM.png','http://couture.zappos.com/marc-by-marc-jacobs-new-q-karlie-cement=painlessgift.com',25,60,'mf','Accessories'),(3,'Tory Burch Wallet ','Defined by a clean, versatile shape punctuated with a cut-out double-T logo, our new Britten Zip Continental Wallet is made of soft pebbled leather. The gently curved style has multiple pockets and a long silhouette that fits all full-length bills without folding. It’s a great everyday organizer.','tory-burch-wallet',195,'Screen_Shot_2015-09-15_at_7.55.38_PM.png','http://www.toryburch.com/britten-zip-continental-wallet/31159053.html?dwvar_31159053_size=OS&cgid=accessories-wallets&dwvar_31159053_color=001&start=1',25,60,'mf','Accessories'),(4,'BLANKNYC- Hotel Distressed Skinny Jeans ','Destroyed details punctuate supersoft&nbsp;skinny jeans in a versatile medium-blue wash. Lived-in whiskering&nbsp;and fading further the authentic, time-worn appeal of this wear-everywhere pair.<ul><li>31\" inseam; 11\" leg opening; 9 1/2\" front rise; 14\" back rise (size 29).</li><li>Zip fly with button closure.</li><li>Five-pocket style.</li><li>49% lyocell, 41% cotton, 8% polyester, 2% spandex.</li><li>Machine wash cold, tumble dry low.</li><li>By BLANKNYC; imported.</li><li>Savvy.</li></ul><p>Watch the video:&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"http://shop.nordstrom.com/s/hotel-skinny/sizeAndFitInfo/4101656?tn=Sizeandfit_popup&amp;origin=fitVideo\">Denim Fit Fundamentals</a></p><p>Learn More:&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"http://shop.nordstrom.com/s/hotel-skinny/sizeAndFitInfo/4101656?tn=Sizeandfit_popup&amp;origin=fit\">Defining the Rise-Women\'s</a></p>','blanknyc-hotel-distressed-skinny-jeans',88,'Screen_Shot_2015-09-15_at_8.05.36_PM.png','http://shop.nordstrom.com/s/hotel-skinny/4101656?cm_cat=partner&cm_ite=4101656&cm_pla=15&cm_ven=Linkshare&siteId=QFGLnEolOWg-ZhN3xqkcLSjBJjNrX0tmeA',20,35,'mf','Apparel'),(5,'Vera Bradley Traveler Bag','<div><p>This carry-on compliant travel bag has all the features travelers have requested. A trolley sleeve allows the Grand Traveler to ride atop rolling luggage. Two pockets under the front magnetic flap and two slip pockets on the back of the bag provide flexible options for travel necessities like travel documents, phone and keys. The adjustable shoulder strap provides a hands-free option to the comfortable rolled handles.</p></div><h2>DETAILS &amp; CARE TIPS</h2><div><h3>Details</h3><ul><li>Carry-on compliant</li><li>Trolley sleeve option lets you slip it onto a rolling luggage piece</li><li>Two slip pockets in back and two slip pockets underneath the front magnetic flap</li><li>Four large slip pockets inside</li><li>Includes rolled handles and a removable adjustable shoulder strap</li><li>Exterior ID window and zip closure</li></ul><h3>Dimensions</h3><p>21\" W x 14½\" H x 9½\" D with 7\" strap drop and 52½\" removable strap</p><h3>Care Tips</h3>Machine Wash</div>','vera-bradley-traveler-bag',98,'Screen_Shot_2015-09-15_at_8.29.58_PM.png','http://www.verabradley.com/product/weekender-travel-bag/katalina-pink/1001684_202024.uts?N=50003',40,60,'mf','Apparel'),(6,'Mimosa & Cardamom Cologne','Mists of honeyed, golden mimosa float above the spiciness of freshly crushed cardamom. Creamy tonka and smooth sandalwood woven under powdery heliotrope and Damask rose picked at dawn. Warm, ethereal, mesmerising.','mimosa-cardamom-cologne',65,'Screen_Shot_2015-09-15_at_8.34.54_PM.png','http://www.jomalone.com/product/3567/37444/Most-Loved/Mimosa-Cardamom-Cologne',40,60,'mf','Beauty'),(7,'Amazon Kindle ','<i>New</i>—With twice as many pixels as the previous generation, the all-new Kindle Paperwhite has an improved high-resolution 300 ppi display for crisp, laser quality text. No other e-reader offers a higher resolution display.','amazon-kindle',119,'Screen_Shot_2015-09-15_at_8.39.26_PM.png','http://www.amazon.com/dp/B00OQVZDJM?tag=googhydr-20&hvadid=84858971945&hvpos=1t1&hvexid=&hvnetw=g&hvrand=9730831673442135055&hvpone=&hvptwo=&hvqmt=e&hvdev=c&ref=pd_sl_2qq09adsl_e',15,60,'mf','Electronics'),(8,'Anthropologie Candle','<span>In Mississippi, the artisans of Capri Blue honor the traditions of candle-makers from generations past by hand-pouring their signature soy wax blends into recycled glass vessels. Each clean-burning formula absorbs more fragrance oil than any other natural wax candle, and lasts twice as long.<span>&nbsp;<br><br>Volcano:</span>&nbsp;tropical fruits, sugared oranges, lemons, and limes, redolent with lightly exotic mountain greens</span>Coastal: notes of pineapple, verbena and coconut, accented by sparkling lemon, bergamot, and grapefruit<div><div><div><ul><li>85&nbsp;hour burn time</li><li>Paraffin-soy wax blend, fragrance</li><li>USA</li></ul></div><ul><li>Style No. B19851559</li></ul><div></div></div><div><div><h3>Dimensions</h3><ul><li>20.5 oz</li><li>5\"H, 4\" diameter</li></ul></div></div></div>','anthropologie-candle',28,'Screen_Shot_2015-09-15_at_8.57.31_PM.png','http://www.anthropologie.com/anthro/product/home-candle/B19851559.jsp?color=046;jsessionid=447BD71D1A5FE0818DB5BAAF1BA3C0F3.anphlpapp01-store02#/',35,60,'mf','Other'),(9,'Pottery Barn Throw Blanket','The ultimate in luxurious comfort, our superior-quality faux fur is as indulgent as it is beautiful. It\'s exceptionally woven from the finest&nbsp;materials&nbsp;for a sumptuously plush feel, and its handsome texture beautifully emulates the inherent softness and color variation of genuine fur.<ul><li>50 x 60\"</li><li>Front is made of a modacrylic/polyester blend.</li><li>Reverses to solid.</li><li>Machine wash ok. But dry-clean for best results.</li><li>Imported.</li></ul>','pottery-barn-throw-blanket',129,'Screen_Shot_2015-09-16_at_7.34.24_AM.png','http://www.potterybarn.com/products/faux-fur-solid-blanket-sham/?pkey=cthrows-blankets&&cthrows-blankets',30,60,'mf','Other'),(10,'Alex and Ani Cross Wrap','The Cross Wrap represents the union of the concepts of divinity. The cross is one of the most ancient human symbols and is used by many religions to represent the crucifixion of Jesus Christ symbolizing health, fertility, life, immortality, and the union of Heaven and Earth. Wear this symbol to honor your personal beliefs in the cross.','alex-and-ani-cross-wrap',58,'Screen_Shot_2015-09-16_at_7.46.00_AM.png','http://www.alexandani.com/top-trending/cross-wrap-expanable-wire-bangle.html',15,60,'mf','Jewelry'),(11,'Toms Shoes ','The shoe that started the One for One movement.<ul><li>Canvas upper with TOMS toe-stitch, and elastic V for easy on and off</li><li>TOMS classic suede insole with cushion for comfort</li><li>Latex arch insert for added support</li><li>One-piece outsole for flexibility and durability</li></ul><br><b><i>With every pair you purchase, TOMS will give a pair of new shoes to a child in need. One for One.</i></b><div><b><i><br></i></b></div>','tome-shoes',48,'Screen_Shot_2015-09-16_at_7.48.08_AM.png','http://www.toms.com/women/light-grey-womens-canvas-classics',15,40,'mf','Shoes'),(12,'Cheeky Teacup ','Classy teacup topped with a side of serious sass. Finished with gilded detailing + an elegant floral print for a fun little cuppa contrast.','cheeky-teacup',16,'Screen_Shot_2015-09-16_at_7.57.04_AM.png','http://www.urbanoutfitters.com/urban/catalog/productdetail.jsp?id=29416849&category=A_FURN_DINNERWARE&cm_mmc=CJ-_-Affiliates-_-ShopStyle.com-_-11389065',20,35,'mf','Other'),(13,'Havaianas Flip Flops','The Slim Crystal Glamour SW features a sparkling Swarovski Elements pin embellishment on a slim metallic strap for eye-catching appeal. A tonal Havaianas logo and our signature textured footbed provide style and comfort.<ul><li>Thong style</li><li>Cushioned footbed with textured rice pattern and rubber flip flop sole</li><li>Made in Brazil</li></ul>','havaianas-flip-flops',32,'Screen_Shot_2015-09-16_at_8.03.21_AM.png','http://us.havaianas.com/women-sandals/slim-crystal-glamour.html',15,40,'mf','Shoes'),(14,'J Crew Ballet Flats','We resurrected one of our most popular ballet flats from the J.Crew archives—and for good reason. With a cushioned insole for maximum comfort, a rubber sole for maximum flexibility and an elasticized detail so they hug your feet, they\'re as comfortable as they are good looking.<ul><li>Leather upper.</li><li>Elasticized topline.</li><li>Cushioned insole, slight interior wedge.</li><li>Rubber sole.</li><li>Import.</li></ul>','j-crew-ballet-flats',125,'Screen_Shot_2015-09-15_at_8.13.52_PM.png','https://www.jcrew.com/womens_category/shoes/ballets/PRDOVR~64408/64408.jsp',40,60,'mf','Shoes'),(15,'Beats Solo2 Headphones','<ul><li>Fine-tuned acoustics for clarity, breadth and balance</li><li>Streamlined design for a custom fit</li><li>Durable and foldable so you can take them on-the-go</li><li>Take calls and control music with RemoteTalk™ cable*</li><li>(*Compatible with iOS devices. Functionality may vary by device.)</li><li>Also available in Wireless.</li></ul>','beats-solo2-headphones',199.95,'Screen_Shot_2015-09-16_at_8.23.19_PM.png','http://www.beatsbydre.com/headphones/solo2/black/900-00134.html',20,50,'mf','Electronics'),(16,'Clarks Mens Boot ','An international cult classic, the iconic men\'s Desert® Boot by Clarks Originals® was inspired by crepe-soled boots worn by British officers in World War II. Crafted from natural materials including beeswax leather for supreme comfort, its timeless styling has remained unchanged for over 60 years.','clarks-mens-boot',130,'Screen_Shot_2015-09-16_at_8.26.21_PM.png','http://www.clarksusa.com/us/mens/mens-medium-width/Mens-Desert-Boot-Beeswax/p/26106562',15,60,'mf','Shoes'),(17,'J Crew Travel Kit','<ul><li>Cotton twill.</li><li>4 5/8\"H x 10\"W x 5 5/8\"D.</li><li>Import.</li></ul>','j-crew-travel-kit',39.5,'Screen_Shot_2015-09-16_at_8.29.55_PM.png','https://factory.jcrew.com/mens-clothing/accessories/bags/PRDOVR~01195/01195.jsp?color_name=Tan&srcCode=FAGGPF00001_99103216599&sisearchengine=197&siproduct=01195&noPopUp=true&gclid=CJL-qaeR_McCFRRlfgodi3UMsQ&gclsrc=aw.ds',20,60,'mf','Accessories'),(18,'Ray Ban Wayfarer Classic','Go back to where it all began with Ray-Ban&nbsp;<b>New Wayfarer Classic</b>&nbsp;sunglasses. Using the same iconic shape as the classic&nbsp;<a target=\"_blank\" rel=\"nofollow\" href=\"http://www.ray-ban.com/usa/sunglasses/wayfarer/clv\">Wayfarer<