.com?key=91e1cceb1f9dfc8e2270159bb91544f2&u=http%3A%2F%2Fwww1.macys.com%2Fshop%2Fproduct%2Fmichael-kors-jet-set-shadow-passcase-billfold%3FID%3D2289256%26CategoryID%3D47665%26LinkType%3D%26selectedSize%3D%23fn%3Dsp%253D1%2526spc%253D543%2526slotId%253D2',31,65,'mf','Accessories'),(508,'Buck Mason','<div>Our Crew Pima Tee is exceptionally comfortable. We took the popular rounded shirttail of our classic Slub Crew and rebuilt it in smooth, breathable 100% pima cotton that works on its own or as an undershirt.<br></div>','buck-mason',28,'Screen_Shot_2016-10-10_at_7.39.02_PM.png','https://www.buckmason.com/singles/white-pima-crew-tee',15,65,'mf','Apparel'),(509,'Buck Mason Desert Venice Wash Slub Tee','Our crew tee is built entirely from slub cotton. Slub is lightly textured fabric made on small batch, low-tension looms. Our Venice Wash targets cellulose fibers in cotton, resulting in unparalleled softness and incredible drape. The rounded shirttail lends a tailored look to an everyday essential.','buck-mason-desert-venice-wash-slub-tee',32,'Screen_Shot_2016-10-10_at_7.40.25_PM.png','https://www.buckmason.com/singles/desert-venice-wash-slub-tee',15,49,'mf','Apparel'),(510,'Buck Mason Sand Chino','Our chino is a classic mid-rise straight leg, made of strong twill fabric that’s durable but cool to the touch. We only left fabric where it\'s needed, with a clean silhouette from the lower thigh down. Our chino will get you through the workday.','buck-mason-sand-chino',135,'Screen_Shot_2016-10-10_at_7.42.23_PM.png','https://www.buckmason.com/singles/sand-chino-pants',15,65,'mf','Apparel'),(511,'Buck Mason The Boss Slim Fit Jean','The Boss looks and feels like your favorite old pair of jeans straight out of the box. Made from durable 13.5 oz indigo denim fabric then washed and hand sanded to an authentic light blue hue that would make Bruce himself envious.','buck-mason-the-boss-slim-fit-jean',175,'Screen_Shot_2016-10-10_at_7.44.07_PM.png','https://www.buckmason.com/singles/boss-wash-slim-fit-jean',15,39,'mf','Apparel'),(512,'Buck Mason Dark Chino','Our chino is a classic mid-rise straight leg, made of strong twill fabric that’s durable but cool to the touch. We only left fabric where it\'s needed, with a clean silhouette from the lower thigh down. Our chino will get you through the workday.','buck-mason-dark-chino',135,'Screen_Shot_2016-10-10_at_7.45.46_PM.png','https://www.buckmason.com/singles/bark-chino-pants',15,65,'mf','Apparel'),(513,'Buck Mason Black Perfect Oxford','Oxford button-ups were first worn by Polo players 200 years ago. Back then, shirts had removable collars, and the first Oxfords fused them into one. Following a tradition of effortless innovation, our Yarn-Dyed Oxford features smooth, substantial cotton fabric in time-tested cuts. A little more casual than the Pinpoint series, they can be ironed for a dressed up look, or washed and dried for something more laid back. Goes great with jeans and chinos.','buck-mason-black-perfect-oxford',125,'Screen_Shot_2016-10-10_at_7.50.35_PM.png','https://www.buckmason.com/singles/black-oxford-shirt',31,65,'mf','Apparel'),(514,'Buck Mason Tan Slim Cowboy Pearl Snap','Our Cowboy Pearl Snap is made like they were in the 1950’s, easy to unsnap on the ranch in barbed wire…or caught in a subway door. The back yoke broadens up your shoulders and the soft, shiny grain of the Sateen fabric will stand the test of time. We developed our own fabric, and custom made the cream pearl-snap buttons to ensure this would be the one, true cowboy shirt.','buck-tan-slim-cowboy-pearl-snap',145,'Screen_Shot_2016-10-10_at_7.58.01_PM.png','https://www.buckmason.com/singles/tan-cowboy-pearl-snap-shirt',21,49,'mf','Apparel'),(515,'Buck Mason Light Blue Pinpoint Oxford','Our Pinpoint Oxford is cut from a lightweight, 3.5 ounce, plain weave cotton. It’s a tighter weave, so it lays a little crisper, a little more formal, and it still looks great with a pair of jeans. Cut the same as our signature Oxfords, true-to-size, tailored, and still the most comfortable shirt you’ll ever wear.','buck-mason-light-blue-pinpoint-oxford',125,'Screen_Shot_2016-10-10_at_8.07.50_PM.png','https://www.buckmason.com/singles/light-blue-pinpoint-oxford-shirt',21,49,'mf','Apparel'),(516,'Buck Mason Steel Slub Pocket Tee','<br>The Slub pocket tee takes our soft, breathable slub cotton fabric, and combines it with a useful pocket, placed right, to look great.','buck-mason-steel-slub-pocket-tee',32,'Screen_Shot_2016-10-10_at_8.15.32_PM.png','https://www.buckmason.com/singles/steel-slub-pocket-crew-tee',15,39,'mf','Apparel'),(517,'Buck Mason White Sand Venice Wash Slub','Our crew tee is built entirely from slub cotton. Slub is lightly textured fabric made on small batch, low-tension looms. Our Venice Wash targets cellulose fibers in cotton, resulting in unparalleled softness and incredible drape. The rounded shirttail lends a tailored look to an everyday essential.','buck-mason-white-sand-venice-wash-slub',32,'Screen_Shot_2016-10-10_at_8.17.31_PM.png','https://www.buckmason.com/singles/white-sand-venice-wash-slub',15,29,'mf','Apparel'),(518,'Buck Mason Dusk Venice Wash Henley','We washed down and softened up our best-selling henleys in colors inspired by days and nights in Venice beach. Lived in, laid back and delivered straight to you: the new American staple.','buck-mason-dusk-venice-wash-henley',52,'Screen_Shot_2016-10-11_at_5.11.46_PM.png','https://www.buckmason.com/singles/dusk-venice-wash-henley',15,49,'mf','Apparel'),(519,'Buck Mason The Silverbelly Holiday ','A wider, 3 1/2” brim, with a slim binding, matching headband and a custom Stetson X Buck Mason lining. Looks as good on the girlfriend as it does on you','buck-mason-the-silverbelly-holiday',250,'Screen_Shot_2016-10-11_at_5.14.00_PM.png','https://www.buckmason.com/singles/holliday-fur-felt-hat-black',31,65,'mf','Accessories'),(520,'Buck Mason Brown Card Wallet','Man needs a card case. Something slim, that won\'t wreck his back in the car